import React from "react";
import './Timer.css'

const Timer = () => {

    return (
        <div className="timer">
            <div className="container">
                <div className="timer-container">
                    <h1>Timer</h1>
                    <h1>10:30</h1>
                </div>
            </div>

        </div>
    )
}


export default Timer
